import { Component ,OnInit} from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { HttpClient ,HttpHeaders} from '@angular/common/http';
import { Router } from '@angular/router';
import { SharedDataService } from '../../../shared-data.service';
@Component({
  selector: 'app-newmanager',
  templateUrl: './newmanager.component.html',
  styleUrls: ['./newmanager.component.css']
})
export class NewmanagerComponent implements OnInit{

  constructor(private formBuilder: FormBuilder,private http : HttpClient,private router :Router,private shared) { }
  registerForm: FormGroup;
  ngOnInit(): void {
    this.registerForm = this.formBuilder.group({
      firstName: ['', Validators.required],
      lastName: [''],
      email: ['', [Validators.required, Validators.email]],
      password: ['', [Validators.required, Validators.minLength(6)]],
      role: ['', Validators.required]
    });
  }

  get f() { return this.registerForm.controls; }

  onSubmit() {
    if (this.registerForm.invalid) {
      return;
    }

    // Submit the form data
    console.log(this.registerForm.value);
  }

  public allEmployee(){

    const token = this.sharedData.getToken();
    const headers = new HttpHeaders({
      'Authorization': `Bearer ${token}`
    });
    this.http.post("",this.registerForm.value).subscribe((data) =>{
      console.log(data);
    })
  }
}
